import { StyleSheet, Text, View } from 'react-native';
function Contect() {
    return (
        <View style={styles.container}>
            <Text style={{ fontSize: 32 }}>This is contact page</Text>
        </View>
    );
}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
});

export { Contect };
